import React, { useEffect, useState } from "react";
import Slide from "./Slider/Slider";
import "./Carousel.css";
const Carousel = (props) => {
  const [timeduration] = useState(8000);
  const [play, setPlay] = useState(true);
  const [pos, setPos] = useState(0);
  const slides = [
  
    {
      subtitle: "EXPERT GUIDEANCE",
      title: "LATEST STATERGIES",
      link: '/',
      img: 'data:image/jpeg;base64,',
      imgMd:'data:image/jpeg;base64,',
     imgSm : "data:image/jpeg;base64,",
      position: 1,
      class: 'white',
      btntext: 'View more'

    },
    {
      subtitle: "Shop exclusive ladies bags now on ShopiumX",
      title: "LADIES BAGS",
      link: '/',
      img: 'https://halstein.qodeinteractive.com/wp-content/uploads/2021/10/h1-rev-img-02.jpg',
      imgMd:"data:image/jpeg;base64,",

      imgSm:"data:image/jpeg;base64,",
      position: 2,
      class: 'white',
      btntext: 'View more'

    },
    {
      title: 'New Arrivals 2021',
      subtitle: 'Discover New Arrivals',
      link: '/',
      img: 'https://halstein.qodeinteractive.com/wp-content/uploads/2021/10/h1-rev-img-03.jpg',
      imgMd:"data:image/jpeg;base64,",
      imgSm: "data:image/jpeg;base64,",
      position: 3,
      class: 'white',
      btntext: 'View more'
    }
  ];

  const slidesrow = slides?.map((slide, i) => {
    return (
      <Slide
        className={`slide ${slide.class} ${
          pos % slides.length === i && "active"
        }`}
        slide={slide}
        pos={pos}
      />
    );
  });
  const carouselnavrow = slides.map((slide, i) => {
    return (
      <div
        className={`carouselitem ${
          pos % slides.length === i && "activecarouselitem"
        }`}
        onClick={() => {
          setPos(i);
          setPlay(false);
          setTimeout(() => {
            setPlay(true);
          }, 0);
        }}
      >

      </div>
    );
  });

  const [elap, setElap] = useState(0);
  useEffect(() => {
    setPos(0);
  }, []);
  useEffect(() => {
    let timer;
    let elap;
    if (play) {
      timer = setInterval(() => {
        setPos((prev) => prev + 1);
        setElap(0);
      }, timeduration);
      elap = setInterval(() => {
        setElap((prev) => prev + 1);
      }, 1);
    } else {
      clearInterval(timer);
      clearInterval(elap);
      setElap(0);
    }
    return () => {
      clearInterval(timer);
      clearInterval(elap);
      setElap(0);
    };
  }, [play, timeduration]);

  return (
    <div className="carouselbanner">
      <div className="progress">
        <div className="prog" style={{width: (elap*400)/(timeduration)+'%'}}></div>
      </div>
      <div className="slides">{slidesrow}</div>
      <div className="carouselcontrols">
        {carouselnavrow}
        <div className="pause">
          <i
            onClick={() => setPlay(!play)}
            className={play ? "fal fa-pause" : "fal fa-play"}
          ></i>
        </div>
      </div>
    </div>
  );
};
export default Carousel;
